      SELECT DISTINCT * FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT + col2 * ( col0 * 30 ) BETWEEN col0 + col2 * col1 AND col2 / 24 + 38;
  - name: tab0

outputs:
